function transactionDB(e){var t=window.openDatabase(DBname,DBversion,DBdisname,DBsize);t.transaction(e,errorDB)}function CreatQuery(e){e.executeSql("CREATE TABLE IF NOT EXISTS slist (id INTEGER PRIMARY KEY AUTOINCREMENT,newinstall varchar, highestscore Integer, fblogin varchar)",[],function(e){alert("created"),e.executeSql('INSERT INTO slist (id,newinstall,highestscore,fblogin) SELECT "1", "YES", "0", "NULL" WHERE NOT EXISTS (SELECT id FROM slist WHERE id = "1") ',[],function(){alert("inserted")})},errorDB)}function UpdateHighest(e){var t=window.openDatabase(DBname,DBversion,DBdisname,DBsize);t.transaction(function(t){alert("update"),t.executeSql('SELECT highestscore FROM slist WHERE id="1"',[],function(t,s){alert(e),s.rows.item(0).highestscore<e&&(alert(s.rows.item(0).highestscore),t.executeSql('UPDATE slist SET highestscore="'+e+'" WHERE id="1"'))})},errorDB)}function GetHighestScore(){var e=window.openDatabase(DBname,DBversion,DBdisname,DBsize);e.transaction(function(e){e.executeSql('SELECT highestscore FROM slist WHERE id="1"',[],function(e,t){$("#highestscore").text("Your Highest Score: "+t.rows.item(0).highestscore)})})}function errorDB(e){alert("Error processing SQL: "+e.message)}function successDB(){}const DBname="calculateDB",DBversion="1,0;",DBdisname="listDB",DBsize=4e6;